import React from "react";
import "../slider.css";
import { Container } from "react-bootstrap";

const Products = () => {
  return (
    <>
       <div className="product">
           <row>
               <div className="col-12">
                   <h1 className="text-center">Shop Products <div className="line1"></div></h1>
                   <p>Our Collections</p>
               </div>
           </row>
       </div>
    </>
  );
};

export default Products;
